import React from "react";
import { Button, Icon } from "react-materialize";

const Header = props => {
    return(
        <Button 
            node="button"
            type="submit"
            waves="light"
            style={styles.button}
            >Submit
                <Icon right>
                    send
                </Icon>
            </Button>
    )
};

const styles = StyleSheet.create({
    button: {
        backgroundColor: "Green"
    }
})

export default Header;
